import React from 'react';
import TreatmentButton from '../TreatmentButton/TreatmentButton';
import './TreatmentButtonsList.css';

const TreatmentButtonsList = props => {
  return(
    <div className="TreatmentButtonsList-wrapper">
      <TreatmentButton
        label={props.labels[0]}
        isChecked={props.isChecked[0]}
        onClick={props.onClick}
        icon={props.icons[0]}
      />
      <TreatmentButton
        label={props.labels[1]}
        isChecked={props.isChecked[1]}
        onClick={props.onClick}
        icon={props.icons[1]}
      />
      <TreatmentButton
        label={props.labels[2]}
        isChecked={props.isChecked[2]}
        onClick={props.onClick}
        icon={props.icons[2]}
      />
      <TreatmentButton
        label={props.labels[3]}
        isChecked={props.isChecked[3]}
        onClick={props.onClick}
        icon={props.icons[3]}
      />
      <TreatmentButton
        label={props.labels[4]}
        isChecked={props.isChecked[4]}
        onClick={props.onClick}
        icon={props.icons[4]}
      />
    </div>
  );
};

export default TreatmentButtonsList;
